column13:
A dispensing assembly comprising: 
a gantry with an x-axis track and a y-axis track, the y-axis track of the gantry configured to move along the x-axis track of the gantry; 
a dispensing head attached to the y-axis track of the gantry below the y-axis track of the gantry, the dispensing head comprising: 
a contact dispensing unit; and 
a non-contact dispensing unit with a jet tip for dispensing a liquid; 
a dispensing enclosure attached to the y-axis track of the gantry on top of the y-axis track of the gantry, the dispensing enclosure having a pressure reservoir; and 
a tube connecting the jet tip of the non-contact dispensing unit to the pressure reservoir of the dispensing enclosure; 

wherein the contact dispensing unit is attached to the y-axis track of the gantry with a first z-axis track; and 
wherein the non-contact dispensing unit is attached to the contact dispensing unit with a second z-axis track.
